import React from 'react'

const Signup = () => {
  return (
    <div>
      <div className='w-full p-6 rounded-lg shadow-md bg-gray-400'>
       <h1 className='text-3xl font-bold text-center text-gray-300'>Signup</h1>
      </div>
    </div>
  )
}

export default Signup
